import React from 'react';
import { Grid, Chip, Typography } from '@material-ui/core';
import Avatar from '@mui/material/Avatar';

type Props = {
    tagged: boolean;
    user: string;
};

const AvatarUserTimeTags: React.FC<Props> = ({ tagged, user }: Props) => {
    if (tagged) {
        return (
            <Grid container>
                <Grid item xs={6} container direction='row' spacing ={5}>
                    <Grid item >
                        <Avatar variant='rounded' sx={{ width: 70, height: 70 }}>J</Avatar>
                    </Grid>
                    <Grid item direction='column'>
                        <Typography align='left' variant='h5'>John</Typography>
                        <Typography align='left' variant='subtitle1' color='textSecondary'>6h ago</Typography>
                    </Grid>
                </Grid>
                <Grid item container xs={6} direction='row' spacing={1} justifyContent='flex-end' alignItems='flex-start'>
                    <Grid item>
                        <Chip label="primary" />
                    </Grid>
                    <Grid item>
                        <Chip label="primary" />
                    </Grid>
                    <Grid item>
                        <Chip label="primary" />
                    </Grid>
                    <Grid item>
                        <Chip label="primary" />
                    </Grid>
                    <Grid item>
                        <Chip label="primary" />
                    </Grid>
                    <Grid item>
                        <Chip label="primary" />
                    </Grid>
                </Grid>
            </Grid>
        );
    }

    // Without tags
    return (
        <Grid container xs={12} spacing ={5}>
            <Grid item >
                <Avatar variant='rounded' sx={{ width: 70, height: 70 }}>J</Avatar>
            </Grid>
            <Grid item direction='column'>
                <Typography align='left' variant='h5'>John</Typography>
                <Typography align='left' variant='subtitle1' color='textSecondary'>6h ago</Typography>
            </Grid>
        </Grid>
    )
};

export default AvatarUserTimeTags;
